import React from 'react';

import classes from './Car.module.css';

const car = (props) => {
    let timeSince = (time) => {
        const currentTime = new Date();
        const days = (currentTime.getDate() - time.getDate() > 0) ? currentTime.getDate() - time.getDate() + 'd': null;
        const hours = (currentTime.getHours() - time.getHours() > 0) ? currentTime.getHours() - time.getHours() + 'h' : null;
        const minutes = (currentTime.getMinutes() - time.getMinutes() >= 0) ? currentTime.getMinutes() - time.getMinutes() + 'm': null;
        return `${days} ${hours} ${minutes}`
    }
    return (
        <div className={classes.Car}>
            <p className={classes.Ticket}>{props.ticket}</p>
            <p>{timeSince(props.time)}</p>
        </div>
    )
}

export default car;
